import React from "react";
import "./index.css";

function App() {
  let currDate = new Date(2022, 8, 5, 5);
  currDate = currDate.getHours();
  let greetings = "H";
  let cssStyle = {}

  if (currDate >= 1 && currDate <= 11) {
    greetings = "Good Morning";
    cssStyle.color = 'green'
  } else if (currDate >= 12 && currDate <= 7) {
    greetings = "Good Afternoon";
    cssStyle.color = 'orange'
  } else {
    greetings = "Good Evening";
    cssStyle.color = 'grey'
  }
  // let str = 'Hello'
  return (
    <>
      <div>
        <h1>Hello! <span style={cssStyle}>{greetings}</span></h1>
      </div>
    </>
  );
}

export default App;
